'''Nardah Bankers''' are men that run the [[Nardah]] branch of the Bank of Gielinor, and are located in the very south of the town. They are some of the only bankers in RuneScape who are called something other than simply "Banker", and they also look different from the standard banker model, wearing head-dresses and desert-coloured clothing, in the same style as many of the [[Nardah]] citizens.

